import React from 'react'

const Home = () => {
    return (
        <div>
            <h1>BIENVENIDO A LA OMBD</h1>
            <p>Haz click para loguearte o crearte un usuario!</p>
            <button type="button" class="btn btn-primary">Ya tengo un usuario</button>
            <button type="button" class="btn btn-secondary">Crear usuario</button>
        </div>
    )
}

export default Home
